from aiogram import Dispatcherfrom aiogram.types import Messageasync def handler_start(msg: Message):    await msg.answer(        text='Вітаю тебе! Щоб продовжити введи команду /checklist або /c'    )async def handler_help(msg: Message):    await msg.answer(        text='Для заповнення checklist введіть команду /checklist або /c'    )def register_handlers(dp: Dispatcher):    dp.register_message_handler(        handler_start, commands=['start']    )    dp.register_message_handler(        handler_help, commands=['help']    )